syntax = "proto2";

package com.earn;

option optimize_for = SPEED;
option java_package = "com.binance.ws.messages.protobuf.com.earn";
option java_multiple_files = true;
option java_outer_classname = "EarnIndexMsgProto";

message EarnIndexMsg {
	required int64 time = 1;
	required string index = 2;
}
